import React from 'react';

import Header from './components/Header/Header';
import Hero from './components/Hero/Hero';

import classes from './App.module.css';

function App() {
  return (
    <div className={classes.App}>
      <Header/>
      <Hero/>
    </div>
  );
}

export default App;
